-- ----------------------------
-- Table structure for trk_info
-- ----------------------------
DROP TABLE IF EXISTS `trk_info`;
CREATE TABLE `trk_info` (
  `device_id` bigint(20) NOT NULL COMMENT '为IMEI(十进制)或MEID（MEID为十六进制，转成十进制存进数据库）',
  `batch_id` int(11) DEFAULT NULL,
  `org_id` int(20) DEFAULT '4' COMMENT '组织编号',
  `model_id` int(11) NOT NULL COMMENT '产品型号ID',
  `update_id` int(11) DEFAULT '0' COMMENT '升级用硬件版本号唯一',
  `trailer_id` varchar(64) DEFAULT NULL COMMENT '客户自定义trailer_id',
  `imsi` bigint(20) DEFAULT '0' COMMENT '实际使用15位',
  `iccid` varchar(32) DEFAULT '0' COMMENT 'IC卡唯一识别号20个数字',
  `password` varchar(6) DEFAULT '000000' COMMENT 'tracker密码缺省:000000',
  `timezone` int(4) DEFAULT '0' COMMENT '时区：800对应东八区，-700对应西七区， 默认西七区',
  `language` varchar(5) DEFAULT '' COMMENT '“语言;zh-CN、en-US等”',
  `system` tinyint(4) DEFAULT NULL COMMENT '0 GSM 1 CDMA',
  `hw_ver` int(11) DEFAULT '0' COMMENT '硬件版本',
  `ignore_acc` int(11) DEFAULT '0' COMMENT '0否1是',
  `state` tinyint(4) DEFAULT '0' COMMENT '设备状态：0：已录入，1：已测试，2：已激活，3：已暂停，4：已报废',
  `expiration_date` timestamp NULL DEFAULT NULL COMMENT 'null表示tracker尚未激活',
  `modify_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `lat` float(9,6) DEFAULT NULL COMMENT '纬度',
  `lng` float(9,6) DEFAULT NULL COMMENT '经度',
  `hdp` float DEFAULT NULL COMMENT '水平精度  -1为无记录 （位置包目前无该值）',
  `heading` int(11) DEFAULT NULL COMMENT '0-360 行进方向',
  `speed` int(11) DEFAULT '0' COMMENT '当前速度',
  `charging` tinyint(11) DEFAULT NULL COMMENT '是否正在充电',
  `temp` int(11) DEFAULT '0' COMMENT '温度',
  `acc` tinyint(4) DEFAULT NULL COMMENT '供电，发送机是否在运行， 0不在运行，1在运行',
  `ext_in` smallint(6) DEFAULT '0' COMMENT 'external input,有三个输入端口，对应0或者1的开关状态',
  `battery` int(11) DEFAULT NULL COMMENT '剩余电量  百分比',
  `voltage` float DEFAULT NULL COMMENT '当前电压',
  `gps_state` tinyint(4) DEFAULT NULL COMMENT '定位状态，0未定位、1 2D定位、2 3D定位',
  `signals` tinyint(11) DEFAULT '0' COMMENT '基站信号强度',
  `solar` int(11) DEFAULT NULL COMMENT '太阳能充电电流',
  `protect` tinyint(4) DEFAULT NULL COMMENT '保护中 0未保护 1保护',
  `total_mileage` int(11) DEFAULT '0' COMMENT '总里程',
  `method` varchar(4) DEFAULT NULL COMMENT '定位方式：”gps”，”cid”',
  `accuracy` float(9,6) DEFAULT NULL COMMENT '定位精度',
  `alt` int(11) DEFAULT NULL COMMENT '海拔',
  `event` tinyint(11) DEFAULT '1' COMMENT '事件， 0 静止， 1驾驶中, 2 熄火',
  `current` int(11) DEFAULT NULL COMMENT '充电电流',
  `fw_ver` int(11) DEFAULT NULL COMMENT '固件版本，用于显示设备最近一次上报版本',
  `bl_ver` int(11) DEFAULT NULL COMMENT 'Bootloader版本，用于显示设备最近一次上报版本',
  `update_index` int(11) DEFAULT '0' COMMENT '当前配置版本号 用于同步',
  `trail_index` int(11) DEFAULT '0' COMMENT '该终端最新的尾迹点的index 默认为0',
  `report_time` timestamp NULL DEFAULT NULL COMMENT '位置上报时间 （现在用的是服务器时间）',
  `pulse_time` timestamp NULL DEFAULT NULL COMMENT '心跳包时间',
  `update_flag` smallint(6) DEFAULT '0' COMMENT '是否有更新，  1024为更新所有  0为无更新',
  `address` varchar(32) DEFAULT NULL COMMENT '大概地址 （中国为市一级， 美国，澳洲，加拿大，墨西哥为州一级， ）',
  `detail_address` varchar(128) DEFAULT NULL COMMENT '详细地址',
  PRIMARY KEY (`device_id`),
  KEY `model_id` (`model_id`),
  KEY `FK_org_id2` (`org_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of trk_info
