-- Table structure for trk_setting
-- ----------------------------
DROP TABLE IF EXISTS `trk_setting`;
CREATE TABLE `trk_setting` (
  `device_id` bigint(20) NOT NULL COMMENT 'tracker id，根据不同系统，可以是IMEI或MEID',
  `working_pulse_enable` tinyint(4) NOT NULL DEFAULT '1' COMMENT '心跳包工作模式功能0关闭 1打开',
  `working_report_enable` tinyint(4) NOT NULL DEFAULT '1' COMMENT '位置包工作模式功能0关闭 1打开',
  `battery_pulse_enable` tinyint(4) NOT NULL DEFAULT '1' COMMENT '心跳包电池模式功能0关闭 1打开',
  `battery_report_enable` tinyint(4) NOT NULL DEFAULT '1' COMMENT '位置包电池模式功能0关闭 1打开',
  `testmode_pulse_enable` tinyint(4) NOT NULL DEFAULT '1' COMMENT '心跳包测试模式功能0关闭 1打开',
  `testmode_report_enable` tinyint(4) NOT NULL DEFAULT '1' COMMENT '位置包测试模式功能0关闭 1打开',
  `working_pulse_interval` int(12) NOT NULL DEFAULT '3600' COMMENT '心跳包工作模式上报频率（单位秒）',
  `battery_pulse_interval` int(12) NOT NULL DEFAULT '21600' COMMENT '心跳包电池模式功能上报频率（单位秒）',
  `testmode_pulse_interval` int(12) NOT NULL DEFAULT '300' COMMENT '心跳包测试模式功能上报频率（单位秒）',
  `working_report_interval` int(12) NOT NULL DEFAULT '300' COMMENT '位置包工作模式上报频率（单位秒）',
  `battery_report_interval` int(12) NOT NULL DEFAULT '900' COMMENT '位置包电池模式功能上报频率（单位秒）',
  `testmode_report_interval` int(12) NOT NULL DEFAULT '300' COMMENT '位置包测试模式功能上报频率（单位秒）',
  `report_server` varchar(64) NOT NULL DEFAULT 'ts2.anytrek.com:9999' COMMENT '上报地址',
  `test_server` varchar(64) NOT NULL DEFAULT 'ts2.anytrek.com:9999' COMMENT '测试模式上报地址',
  `agps_enabled` tinyint(4) DEFAULT NULL COMMENT '1',
  `gps_weak_timeout` int(11) DEFAULT NULL COMMENT '180',
  `gps_anti_drifting` int(11) DEFAULT '20' COMMENT 'GPS抗漂移延时最大值   单位秒',
  `gps_hdop_threshold` float DEFAULT '4.5' COMMENT '水平分量精度因子的阈值',
  `gsensor_sensitivity` int(11) DEFAULT NULL COMMENT '1',
  `update_index` int(12) NOT NULL DEFAULT '0' COMMENT '更新序号',
  `distance_offset` int(12) NOT NULL DEFAULT '25' COMMENT '偏移距离',
  `time_zone` int(12) NOT NULL DEFAULT '-800' COMMENT '时区',
  `relay_out` tinyint(4) DEFAULT '0',
  `modify_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `flag` tinyint(4) DEFAULT '0' COMMENT '-1 为标记删除',
  PRIMARY KEY (`device_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

