-- ----------------------------
-- Procedure structure for ProcPage
-- ----------------------------
DROP PROCEDURE IF EXISTS `ProcPage`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `ProcPage`(IN `tableName` VARCHAR(20), IN `showField` VARCHAR(100), IN `whereText` VARCHAR(500), IN `orderText` VARCHAR(500), IN `pageSize` INT, IN `pageIndex` INT)
BEGIN  
 
if (pageSize<1)then  
  set pageSize=20;   
end if;  
  
if (pageIndex < 1)then  
  set pageIndex = 1;  
end if;  
  
if(LENGTH(whereText)>0)then  
    set whereText=CONCAT('  ',whereText);  
end if;  
  
if(LENGTH(orderText)>0)then  
    set orderText = CONCAT(' ORDER BY ',orderText);  
end if;  
  
set @strsql = CONCAT('select ',showField,' from ',tableName,' ',whereText,' ',orderText,' limit ',pageIndex*pageSize-pageSize,',',pageSize);  
  
prepare stmtsql from @strsql;  
execute stmtsql;  
deallocate prepare stmtsql;  
  
END
;;
DELIMITER ;

